      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + 52 * + 65 * + - 86 NOT BETWEEN - col2 AND + 4 * + + CAST ( NULL AS INTEGER ) + + col2 - - 91 * - + col2;
  - name: tab2

outputs:
